import React, { useState } from "react";
import "../styles/Home.css";

export function Home() {
  const [isLoginMode, setIsLoginMode] = useState(true);

  return (
    <div className="intro-page">
      {/* Logo and Welcome Section */}
      <div className="welcome-section">
        <div className="logo-container">
          <span className="logo-emoji">ðŸ“š</span>
          <h1 className="logo-text">ReadTogether</h1>
        </div>
        <p className="welcome-text">Share your reading journey with friends</p>
      </div>

      {/* Auth Card */}
      <div className="auth-card">
        {/* Toggle Buttons */}
        <div className="toggle-container">
          <button
            className={`toggle-button ${isLoginMode ? "active" : ""}`}
            onClick={() => setIsLoginMode(true)}
          >
            Login
          </button>
          <button
            className={`toggle-button ${!isLoginMode ? "active" : ""}`}
            onClick={() => setIsLoginMode(false)}
          >
            Sign Up
          </button>
        </div>

        {/* Form */}
        <form className="auth-form">
          {!isLoginMode && (
            <div className="form-group">
              <label>Full Name</label>
              <input type="text" placeholder="Enter your full name" />
            </div>
          )}

          <div className="form-group">
            <label>Email</label>
            <input type="email" placeholder="Enter your email" />
          </div>

          <div className="form-group">
            <label>Password</label>
            <input type="password" placeholder="Enter your password" />
          </div>

          {!isLoginMode && (
            <div className="form-group">
              <label>Confirm Password</label>
              <input type="password" placeholder="Confirm your password" />
            </div>
          )}

          <button type="submit" className="submit-button">
            {isLoginMode ? "Login" : "Sign Up"}
          </button>

          <div className="social-login">
            <p>Or continue with</p>
            <div className="social-buttons">
              <button className="social-button">
                <span>Facebook</span>
              </button>
              <button className="social-button">
                <span>Google</span>
              </button>
              <button className="social-button">
                <span>GitHub</span>
              </button>
            </div>
          </div>
        </form>

        {isLoginMode ? (
          <p className="footer-text">
            Forgot your password?{" "}
            <button className="text-link">Reset it here</button>
          </p>
        ) : (
          <p className="footer-text">
            By signing up, you agree to our{" "}
            <button className="text-link">Terms</button> and{" "}
            <button className="text-link">Privacy Policy</button>
          </p>
        )}
      </div>

      <div className="page-footer">
        <p>Â© 2024 ReadTogether. All rights reserved.</p>
      </div>
    </div>
  );
}
